      string: '[{"name":"Fish Tacos","ingredients":[{"quantity":"1 cup","name":"all-purpose
        flour","preparation":null},{"quantity":"2 tablespoons","name":"cornstarch","preparation":null},{"quantity":"1
        teaspoon","name":"baking powder","preparation":null},{"quantity":"1/2 teaspoon","name":"salt","preparation":null},{"quantity":"1","name":"egg","preparation":null},{"quantity":"1
        cup","name":"beer","preparation":null},{"quantity":"1/2 cup","name":"plain
        yogurt","preparation":null},{"quantity":"1/2 cup","name":"mayonnaise","preparation":null},{"quantity":"1","name":"lime","preparation":"juiced"},{"quantity":"1","name":"jalapeno
