        ounce) package","name":"corn tortillas","preparation":null},{"quantity":"1/2","name":"medium
        head cabbage","preparation":"finely shredded"}],"directions":["To make beer
        batter: In a large bowl, combine flour, cornstarch, baking powder, and salt.
